//       <Link 
//       to="/saved"
//       style={{ color: "white"}}

//       >
//         Saved Books
//       </Link>

//     </nav>

export default function NavBar(props) {
  return(
      <Navbar fixed="top" bg="dark" variant="dark" expand="md" bg-color="darkgrey">
          {/* <Navbar.Brand href="#home">Gina Dannibale</Navbar.Brand> */}
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="mr-auto">
              <Nav.Link
                      href="#home"
                      onClick={() => props.handlePageChange("Home")}
                      activeClass="active"
                      to="Home"
                      spy={true}
                      smooth={true}
                      offset={-70}
                      duration={800}
                      activeClassName="text-white"
                      className="d-inline-block align-top">
                      Gina Dannibale
                  </Nav.Link>
                  <Nav.Link
                      href="#about"
                      onClick={() => props.handlePageChange("About")}
                      activeClass="active"
                      to="About"
                      spy={true}
                      smooth={true}
                      offset={-70}
                      duration={800}
                      activeClassName="text-white"
                      className="d-inline-block align-top">
                      About
                  </Nav.Link>
                  <Nav.Link
                      href="#portfolio"
                      onClick={() => props.handlePageChange("Portfolio")}
                      activeClass="active"
                      to="Portfolio"
                      spy={true}
                      smooth={true}
                      offset={-70}
                      duration={800}
                      activeClassName="text-white"
                      className="">
                      Portfolio
                  </Nav.Link>
                  <Nav.Link
                      href="#contact"
                      onClick={() => props.handlePageChange("Contact")}
                      activeClass="active"
                      to="Contact"
                      spy={true}
                      smooth={true}
                      offset={-70}
                      duration={800}
                      activeClassName="text-white"
                      className="">
                      Contact
                  </Nav.Link>
              </Nav>
              <div className="justify-content-between">
        <SocialIcon
          url="https://github.com/gdannibale"
          className="mr-4"

          target="_blank"
          fgColor="#fff"
          style={{ height: 35, width: 35 }} />
        <SocialIcon
          url="https://www.linkedin.com/in/gina-dannibale-b824303a/"
          className="mr-4"
          target="_blank"
          fgColor="#fff"
          style={{ height: 35, width: 35 }} />
        <SocialIcon
          url="https://1drv.ms/w/s!AuJtakMr1bPAhB7SRl8uC5uM8Q-J?e=klyPkf"
          className="mr-4"
          target="_blank"
          fgColor="#fff"
          style={{ height: 35, width: 35 }} /> */}
      </div>
  {/* { <Form inline>
    <FormControl type="text" placeholder="Search" className="mr-sm-2" />
    <Button variant="outline-info">Search</Button>
  </Form> */}
  </Navbar.Collapse>
</Navbar>

  )
}
